// src/Pages/Default.js
import React from 'react';
import { Link } from 'react-router-dom';

const Default = () => {
  return (
    <div>
      <h1>Welcome to the Default Page</h1>
      <p>Please sign in to your account:</p>
      <Link to="/login">
        <button>Sign In</button>
      </Link>
    </div>
  );
};

export default Default;
